class ErrorSintactico < RuntimeError
  def initialize(token)
    @token = token
  end

  def to_s
    "Error de sintaxis en linea #{@token.linea}, columna #{@token.columna}, token '#{@token.texto}' inesperado."
  end
end
class Parser < Racc::Parser

module_eval(<<'...end Parser.y/module_eval...', 'Parser.y', 197)

    def on_error(id, token, stack)
      raise ErrorSintactico::new(token)
    end

    def next_token
      token = @lexer.yylex
      return [false, false] unless token
      return [token.class, token]
    end

    def parse(lexer)
      @yydebug = true # DEBUG
      @lexer  = lexer
      @tokens = []
      begin
        ast = do_parse
      rescue Error => error
        t = false
        while (!t) do
          begin
            t = lexer.yylex.nil?
          rescue Error => error
          end
        end
        puts lexer
      end
      return ast
    end
